// /src/pages/HomePage/Services.js
import React from "react";
import ServiceCard from "../../components/HomePage/ServiceCard";
import "../../styles/HomePage/Services.css";

const Services = () => {
  const services = [
    { title: "Video Consult", icon: "video-call.png", desc: "Consult top doctors online" },
    { title: "Medicine Delivery", icon: "medicine.png", desc: "Get medicines at your door" },
    { title: "Lab Tests", icon: "lab-test.png", desc: "Book diagnostics tests" },
  ];

  return (
    <section className="services">
      <h2>Our Services</h2>
      <div className="service-cards">
        {services.map((item, index) => (
          <ServiceCard key={index} title={item.title} icon={item.icon} desc={item.desc} />
        ))}
      </div>
    </section>
  );
};

export default Services;
